  ,FIRSTNAME         VARCHAR(30) NOT NULL
  ,LASTNAME          VARCHAR(30) NOT NULL
  ,TEAM_ABBREVIATION VARCHAR(3) NOT NULL
  ,AGE               INTEGER  NOT NULL
  ,GP                INTEGER  NOT NULL
  ,W                 INTEGER  NOT NULL
