 CREATE TABLE Team
(
	[TeamName] NVARCHAR(50) NOT NULL CHECK (DATALENGTH(TeamName) > 0), 
	[Id] NVARCHAR(450)  NOT NULL,
	 [isFav]    BIT   NOT NULL,
